function hist(array){
  for (let countedNum = 1; countedNum < maxNum+1; countedNum++) {
    for (let testNumIndex = 0; testNumIndex < array.length; testNumIndex++) {
      if(countedNum==array[testNumIndex]){
        counts[countedNum-1] = counts[countedNum-1] + 1;
      };
    };
  };
  return counts;
};

function modArray(array,mod){
  for (let i = 0; i < array.length; i++) {
    array[i]=array[i]%mod;
  };
  return array;
};

