function getMaxOfArray(numArray) {
  return Math.max.apply(null, numArray);
}

//Change the Lightbulbs
function changeLightbulb(list, primeFactor){
  let listLength = list.length;

  for (let i = primeFactor-1; i < listLength; i=i+primeFactor) {
    list[i] = (list[i]+1)%2
  };
  return list;
};

